import  Navbar  from "../../Componentes/Navbar";
import Paragrafos from "../../Componentes/Paragrafos";
import ete from "../../imagens/ete.jpg zzzz.jpg"

function Etes () {
    return (
        <>
        <Navbar/>
        <Paragrafos
        texto={ <div className="row bg-primary" id="teste"> 
            <div style={{ marginBottom: '50 px' }}></div>
              <div className="col-3"></div>
              <div className="col-6 align-center text-white">
                <h1 className="text-white"
                style={{ fontWeight: 'bold' }} // Adicionando negrito aqui
                >Projetos da Regi√£o Metropolitana do Recife</h1>
                <div style={{ marginBottom: '22px' }}></div>
                <p  className="text-white " style={{ fontSize: '20px' }}/> <h3>Selecione a cidade da ETE que  deseja  ver os projetos ou CLIQUE aqui para ver todos os projetos do nosso diretorio</h3>
                  <div style={{ marginBottom: '50 px' }}></div>
                  <div className="col-2"></div>
      
                  
              </div>
            </div>}/>
            {ete}
      
        </>
    )
}

export default Etes;
